_t1_check_results:
	ldx	[%l3 + 0x38], %l5	!# Needed _t1_for Copy
	add	%l5, %i5, %l5
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_results
	nop

	or %g0, 0x8, %i0    
	or %g0, %g0, %g3   
_t1_check_sfas:
	ldx	[%l3 + 0x20], %l5
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_sfas 
	nop

    !# I want to check all the State 32 words + 2 bytes XY
	or %g0, 0x23, %i0    
	or %g0, %g0, %g3   
_t1_check_state:
	ldx	[%l3 + 0x28], %l5		!# Needed _t1_for Streamout
	ldx     [%l5 + %g3], %l1
	add     %g3, 0x8, %g3   !# i++
	addcc   %i0, -1, %i0
	bgt     _t1_check_state
	nop

	mov	%g5, %i5
	add	%l6, 0x40, %l6  	!# next CWQ address
	add	%i5, 8, %i5		!# next _t1_offset 
	add	%i4, 1, %i4		!# loop _t1_counter
	cmp 	%i4, 8
	bl	_t1_main_loop
	nop	

	!call 	check_int_cnt		!# Check #ints (assuming all have happened at this time!)
	nop

    	EXIT_GOOD

_t1_fail:
    	EXIT_BAD

